oxy_webhelp_navlinks = {"mt_multitenant_organizations-d22872e41725":{"topics":[{"title":"Tenant organizations","shortdesc":"<p class=\"shortdesc\">Tenant organizations in <span class=\"ph\">RSC<\/span> are a defined subset of the global         organization with specified resources, workloads, SLA Domains, and permissions.<\/p>","href":"saas\/mt_tenant_organizations.html","attributes":{"data-id":"mt_tenant_organizations"},"menu":{"hasChildren":false},"tocID":"mt_tenant_organizations-d22872e41739","topics":[]},{"title":"Multitenancy in <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> supports multitenancy with some similarities to and some         differences from the multitenancy support provided on Rubrik clusters.<\/p>","href":"saas\/mt_multitenancy_in_rsc.html","attributes":{"data-id":"mt_multitenancy_in_rsc"},"menu":{"hasChildren":false},"tocID":"mt_multitenancy_in_rsc-d22872e41753","topics":[]},{"title":"Migration of organizations from Rubrik CDM","shortdesc":"<p class=\"shortdesc\">To successfully migrate organizations from Rubrik CDM to <span class=\"ph\">RSC<\/span>, you         must complete certain tasks.<\/p>","href":"saas\/migration_organizations_from_rubrik_cdm.html","attributes":{"data-id":"migrating_organizations_from_rubrik_cdm"},"menu":{"hasChildren":false},"tocID":"migrating_organizations_from_rubrik_cdm-d22872e41768","topics":[]},{"title":"Global organization administrator privileges","shortdesc":"<p class=\"shortdesc\">The global organization administrator or global organization owner role has         privileges in the global organization as well as the tenant organization.<\/p>","href":"saas\/mt_global_organization_administrator_privileges.html","attributes":{"data-id":"global_orgnization_administrator_privileges"},"menu":{"hasChildren":false},"tocID":"global_orgnization_administrator_privileges-d22872e41782","topics":[]},{"title":"Tenant organization administrator privileges","shortdesc":"<p class=\"shortdesc\">The tenant organization administrator role is assigned specific permissions by the         global organization administrator.<\/p>","href":"saas\/mt_tenant_org_administrator_privileges.html","attributes":{"data-id":"tenant_org_administrator_privileges"},"menu":{"hasChildren":false},"tocID":"tenant_org_administrator_privileges-d22872e41793","topics":[]},{"title":"Tenant organization user privileges","shortdesc":"<p class=\"shortdesc\">The tenant organization user roles are assigned specific permissions by the tenant         organization administrator.<\/p>","href":"saas\/mt_tenant_org_user_privileges.html","attributes":{"data-id":"mt_tenant_org_user_privileges"},"menu":{"hasChildren":false},"tocID":"mt_tenant_org_user_privileges-d22872e41804","topics":[]},{"title":"SLA Domain management","shortdesc":"<p class=\"shortdesc\">In a multitenant environment, SLA Domains can be assigned to tenant organizations by         the global organization administrator during the tenant organization creation or editing         process. <span class=\"ph\">Tenant organizations can also be provided the ability to create and manage their             own SLA Domains.<\/span><\/p>","href":"saas\/mt_sla_domain_management_multitenancy.html","attributes":{"data-id":"mt_sla_domain_management_multitenancy"},"menu":{"hasChildren":false},"tocID":"mt_sla_domain_management_multitenancy-d22872e41815","topics":[]},{"title":"SSO options for tenant organizations","shortdesc":"<p class=\"shortdesc\">The global organization administrator can configure SSO options for user access in         the tenant organizations.<\/p>","href":"saas\/mt_SSO_options_for_tenant_organizations.html","attributes":{"data-id":"mt_SSO_options_for_tenant_organizations"},"menu":{"hasChildren":false},"tocID":"mt_SSO_options_for_tenant_organizations-d22872e41828","topics":[]},{"title":"Multifactor authentication for a tenant organization","shortdesc":"<p class=\"shortdesc\">Enabling multifactor authentication adds one or more factors to the basic         authentication process and is recommended to protect against ransomware and other         vulnerabilities.<\/p>","href":"saas\/mt_MFA_for_tenant_org.html","attributes":{"data-id":"mt_MFA_for_tenant_org"},"menu":{"hasChildren":false},"tocID":"mt_MFA_for_tenant_org-d22872e41839","topics":[]},{"title":"Replication for tenant organizations","shortdesc":"<p class=\"shortdesc\">The global organization administrator sets up replication targets, options, and         permissions for the tenant organization when creating or editing the organization. <\/p>","href":"saas\/mt_replication_tenant_org.html","attributes":{"data-id":"mt_replication_tenant_org"},"menu":{"hasChildren":false},"tocID":"mt_replication_tenant_org-d22872e41850","topics":[]},{"title":"Archival locations for tenant organizations","shortdesc":"<p class=\"shortdesc\">The global administrator can assign archival location options or archival view and         manage privileges to the tenant organization during organization creation or editing. <\/p>","href":"saas\/mt_archival_locations_for_tenant_orgs.html","attributes":{"data-id":"mt_archival_locations_for_tenant_orgs"},"menu":{"hasChildren":false},"tocID":"mt_archival_locations_for_tenant_orgs-d22872e41862","topics":[]},{"title":"Creating a tenant organization","shortdesc":"<p class=\"shortdesc\">Create a tenant organization by adding a name, adding user accounts, and assigning         clusters and objects to protect.<\/p>","href":"saas\/mt_creating_tenant_org.html","attributes":{"data-id":"mt_creating_tenant_org"},"menu":{"hasChildren":false},"tocID":"mt_creating_tenant_org-d22872e41873","next":"mt_creating_tenant_org-d22872e41873"},{"title":"Events and reports for tenant organizations","shortdesc":"<p class=\"shortdesc\">Events and reports for tenant organizations are limited to the objects and privileges         assigned to them.<\/p>","href":"saas\/mt_events_reports_tenants.html","attributes":{"data-id":"mt_events_reports_tenants"},"menu":{"hasChildren":false},"tocID":"mt_events_reports_tenants-d22872e41937","topics":[]},{"title":"Certificate and Certificate Signing Request management for organizations","shortdesc":"<p class=\"shortdesc\">Tenant organizations with the required permissions can view and manage certificates         and Certificate Signing Requests for their organizations.<\/p>","href":"saas\/mt_cert_csr_mgmt_orgs.html","attributes":{"data-id":"mt_cert_csr_mgmt_orgs"},"menu":{"hasChildren":false},"tocID":"mt_cert_csr_mgmt_orgs-d22872e41948","topics":[]},{"title":"Organization branding","shortdesc":"<p class=\"shortdesc\">Organization branding personalizes <span class=\"ph\">RSC<\/span> by displaying a selected         custom brand logo for all users in the global organization and associated tenant         organizations.<\/p>","href":"saas\/organization_branding.html","attributes":{"data-id":"organization_branding"},"menu":{"hasChildren":false},"tocID":"organization_branding-d22872e41959","next":"organization_branding-d22872e41959"},{"title":"Tenant organization storage quota","shortdesc":"<p class=\"shortdesc\">Storage-based quotas can be assigned to tenant organizations in multitenant         environments to restrict resource utilization and protect resource availability.<\/p>","href":"cdm\/tenant_storage_quota.html","attributes":{"data-id":"tenant_storage_quota"},"menu":{"hasChildren":false},"tocID":"tenant_storage_quota-d22872e41987","next":"tenant_storage_quota-d22872e41987"}]}};